package com.example.moviedevappimport android.os.Bundleimport androidx.activity.ComponentActivityimport androidx.activity.compose.setContentimport com.example.feature.movies.presentation.store.MoviesStoreimport com.example.feature.movies.presentation.ui.MoviesScreenimport com.example.moviedevapp.ui.theme.MovieDevAppThemeimport javax.inject.Injectclass MainActivity : ComponentActivity() {    @Inject    lateinit var store : MoviesStore    override fun onCreate(savedInstanceState: Bundle?) {        super.onCreate(savedInstanceState)        setContent {            MovieDevAppTheme {                MoviesScreen(store = store)            }        }    }}